import React from "react";
import Img from "./../../img/intro_desktop.jpg";

function Motto() {
  return (
    <section className="w-full">
      <div className="w-full min-h-[721px]">
        <ImgMotto />
      </div>
    </section>
  );
}

function ImgMotto() {
  return (
    <figure className="h-full w-1/2">
      <img src={Img} className="rotate-90" alt="ImgMotto" />
    </figure>
  );
}

export default Motto;
